import './Header.css';

const Header = () => {
    return (
        <>
            <div className="navbar">
                <div className="navbar-left">
                    <span>Home</span>
                    <span>About</span>
                </div>
                <div className="navbar-right">
                    <button className="navbar-button">Notifications</button>
                    <button className="navbar-button">Reminders</button>
                    <button className="navbar-button">User Profile</button>
                </div>
            </div>
        </>
    )
};

export default Header;
